// Front-end: HTML, CSS, JavaScript (React)
// Back-end: Server-side language (Node.js), Database (MongoDB)`,exercise:{id:"ex-fs-1",title:"Identify the Technology",question:"In a full-stack application, which technology is primarily responsible for styling the user interface?",initialCode:`// Answer with one of the following:
// A) Node.js
// B) SQL
// C) CSS`,isCompleted:!1,hint:'The "C" in CSS stands for "Cascading Style Sheets".',documentationLink:"https://developer.mozilla.org/en-US/docs/Learn/Front-end_web_developer"},quiz:{id:"quiz-fs-1",questions:[{id:"q1",questionText:'What is the "front-end" of a web application?',options:["The server and database","The part the user interacts with in the browser","The network infrastructure","The operating system"],correctAnswerIndex:1},{id:"q2",questionText:'What is the "back-end" responsible for?',options:["Styling buttons","Running on the user's computer","Server-side logic and database interactions","Displaying images"],correctAnswerIndex:2},{id:"q3",questionText:"A full-stack developer works on:",options:["Only the front-end","Only the back-end","Both the front-end and back-end","Only the database"],correctAnswerIndex:2}]}},{id:"fs-2",title:"Introduction to Node.js",shortDescription:"Learn what Node.js is and how it allows you to run JavaScript on the server.",longDescription:"Node.js is a runtime environment that allows you to execute JavaScript code outside of a browser. This is what makes it possible to build the back-end of a web application using JavaScript. It's known for its speed and efficiency.",exampleCode:`// To run this code, you need Node.js installed
// File: server.js
const http = require('http');

const server = http.createServer((req, res) => {
  res.statusCode = 200;
  res.setHeader('Content-Type', 'text/plain');
  res.end('Hello from Node.js server!');
});

server.listen(3000, '127.0.0.1', () => {
  console.log('Server running...');
});`,exercise:{id:"ex-fs-2",title:"Complete the Code",question:"Node.js is a _______ that lets you run JavaScript on the server.",initialCode:`// Fill in the blank:
// A) JavaScript library
// B) Database
